  true,\n\t\"url\": null,\n\t\"notes\": \"IDEA Part B State Performance Plan and Annual
  Performance Report, Fiscal Year 2005 (IDEA Part B SPP/APR FY2005), is a study that
  is part of the IDEA Part B State Performance Plan and Annual Performance Report
  (IDEA Part B SPP/APR) program; program data is available since 2002-03 at <http://www2.ed.gov/fund/data/report/idea/partbspap/allyears.html>.
  IDEA Part B SPP/APR FY2005 (http://idea.ed.gov/explore/home) is a cross-sectional
  study that collects State Performance Plans that evaluate the state lead agencyufffds
  efforts to implement the requirements and purposes of Part B of the Individuals
  with Disabilities Education Act and describe how the lead agency will improve such
  implementation. The study also collects Annual Performance Reports which report
  annually to the public on the intervention service programs located in the state
  on the targets in the lead agencyufffds performance plan. They studyufffds response
  rate was 100 percent. Key statistics produced from IDEA Part B SPP/APR FY2005 are
  children age 3-21 participating in intervention programs and effectiveness of such
  programs, and other performance indicators.\",\n\t\"license_title\": \"Creative
